  true,\n\t\"url\": null,\n\t\"notes\": \"This paper presents a novel set of uncertainty
  measures to quantify the impact of input uncertainty on nonlinear prognosis systems.
  A Particle Filtering-based method is also presented that uses this set of uncertainty
  measures to quantify, in real time, the impact of load, environmen- tal, and other
  stresses for long-term prediction. Further- more, this work shows how these measures
  can be used to implement a novel feedback correction loop aimed to suggest modifications,
  at a system input level, with the purpose of extending the remaining useful life
  of a faulty nonlinear, non-Gaussian system. The correction scheme is tested and
  illustrated using real vibration feature data from a fatigue-driven fault in a critical
  aircraft compo- nent.\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
